標準組立費とは地面が土で高低差が目で確認できない場合（平坦）に適応します<br />
１．設置場所が地上面致しませんで地面が土の場合、もしくは砂利で簡単に地面が露出できるかを確認<br />
ベランダや屋上などの地上面以外の設置は安全上お受けできません<br />
２．ブロックを設置<br />
３．ブロック上を水平にします。（この作業が一番大切で難しい作業です）<br />
４．部品を組み上げていきます。<br />
地面との固定は致しませんので、屋外に設置する場合は必ず転倒防止工事をすることをお勧めします。春一番や台風などの風に対し、倒れにくくなります。<!--左追いかけバナー セール用-->

